const myImage = new Image();
myImage.src =
    "data:image/png;base64,";

myImage.addEventListener("load", function () {
    const canvas = document.getElementById("canvas1");
    const ctx = canvas.getContext("2d");
    canvas.width = 600;
    canvas.height = 800;
    const radiusSlider = document.getElementById("radius-slider");

    ctx.drawImage(myImage, 0, 0, canvas.width, canvas.height);
    const pixels = ctx.getImageData(0, 0, canvas.width, canvas.height);
    ctx.clearRect(0, 0, canvas.width, canvas.height);

    const mouse = {
        x: null,
        y: null,
        radius: canvas.width * radiusSlider.value, // You can adjust this to control the interaction radius
    };

    let verticalDirection = true; // Default to vertical direction

    canvas.addEventListener("click", function () {
        verticalDirection = !verticalDirection; // Toggle the direction
    });

    canvas.addEventListener("mousemove", function (event) {
        const rect = canvas.getBoundingClientRect(); // Get the canvas's bounding rectangle
        mouse.x = event.x - rect.left; // Subtract the left offset
        mouse.y = event.y - rect.top; // Subtract the top offset
    });

    canvas.addEventListener("mouseleave", function () {
        mouse.x = undefined;
        mouse.y = undefined;
    });

    let particlesArray = [];
    const numberOfParticles = 5000;

    let mappedImage = [];
    for (let y = 0; y < canvas.height; y++) {
        let row = [];
        for (let x = 0; x < canvas.width; x++) {
            const red = pixels.data[y * 4 * pixels.width + x * 4];
            const green = pixels.data[y * 4 * pixels.width + (x * 4 + 1)];
            const blue = pixels.data[y * 4 * pixels.width + (x * 4 + 2)];
            const brightness = calculateRelativeBrightness(red, green, blue);
            const cell = [(cellBrightness = brightness)];
            row.push(cell);
        }
        mappedImage.push(row);
    }
    console.log(mappedImage);

    function calculateRelativeBrightness(red, green, blue) {
        return Math.sqrt(red * red * 0.299 + green * green * 0.587 + blue * blue * 0.114) / 100;
    }

    function getColorFromBrightness(brightness) {
        const adjustedBrightness = brightness * brightnessFactor; // Apply the brightness factor
        const hue = adjustedBrightness * 100; // You can adjust how the brightness maps to hue here
        return `hsl(${hue}, 100%, 50%)`;
    }

    const brightnessSlider = document.getElementById("brightness-slider");
    let brightnessFactor = 1; // This variable will control the brightness factor

    brightnessSlider.addEventListener("input", function () {
        brightnessFactor = this.value; // Update the brightness factor with the slider value
    });

    // let radiusFactor = 1;
    // radiusFactor.addEventListener("input", function () {
    //     radiusFactor = this.value2;
    // });
    radiusSlider.addEventListener("input", function () {
        mouse.radius = canvas.width * this.value; // Update the mouse radius based on the slider value
    });

    class Particle {
        constructor() {
            this.x = Math.random() * canvas.width;
            this.y = 0;
            this.speed = 0;
            this.velocity = Math.random() * 0.5;
            this.size = Math.random() * 1.5 + 1;
            this.position1 = Math.floor(this.y);
            this.position2 = Math.floor(this.x);
        }
        update() {
            this.position1 = Math.floor(this.y);
            this.position2 = Math.floor(this.x);

            // Check if positions are within bounds
            if (
                this.position1 >= 0 &&
                this.position1 < canvas.height &&
                this.position2 >= 0 &&
                this.position2 < canvas.width
            ) {
                this.speed = mappedImage[this.position1][this.position2][0];
            }

            let movement = 2.5 - this.speed + this.velocity;

            let dx = mouse.x - this.x;
            let dy = mouse.y - this.y;
            let distance = Math.sqrt(dx * dx + dy * dy);

            if (verticalDirection) {
                // Vertical direction logic (top to bottom)
                this.y += movement;
                if (this.y >= canvas.height) {
                    this.y = 0;
                    this.x = Math.random() * canvas.width;
                }
            } else {
                // Horizontal direction logic (right to left)
                this.x -= movement;
                if (this.x <= 0) {
                    this.x = canvas.width;
                    this.y = Math.random() * canvas.height;
                }
            }

            if (distance < mouse.radius) {
                this.x -= (dx / distance) * 5;
                this.y -= (dy / distance) * 5;
            }
        }

        draw() {
            ctx.beginPath();
            ctx.fillStyle = getColorFromBrightness(this.speed); // Use the new function here
            ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);
            ctx.fill();
        }
    }
    function intit() {
        for (let i = 0; i < numberOfParticles; i++) {
            particlesArray.push(new Particle());
        }
    }
    intit();
    function animate() {
        ctx.globalAlpha = 0.05;
        ctx.fillStyle = "rgb(0, 0, 0)";
        ctx.fillRect(0, 0, canvas.width, canvas.height);
        ctx.globalAlpha = 0.2;

        if (mouse.x && mouse.y) {
            for (let y = mouse.y - mouse.radius; y < mouse.y + mouse.radius; y++) {
                for (let x = mouse.x - mouse.radius; x < mouse.x + mouse.radius; x++) {
                    if (y >= 0 && y < canvas.height && x >= 0 && x < canvas.width) {
                        const distance = Math.sqrt((x - mouse.x) ** 2 + (y - mouse.y) ** 2);
                        if (distance < mouse.radius && mappedImage[y] && mappedImage[y][x]) {
                            mappedImage[y][x][0] = 0; // Make the brightness zero in the circle around the cursor
                        }
                    }
                }
            }
        }

        for (let i = 0; i < particlesArray.length; i++) {
            particlesArray[i].update();
            ctx.globalAlpha = particlesArray[i].speed * 0.5;
            particlesArray[i].draw();
        }

        requestAnimationFrame(animate);
    }

    animate();
});
